import itemCss from './TodoItem.module.scss'

import correct from '../../assets/correct.png'
import incorrect from '../../assets/discorrect.png'


const TodoItem = ({item}) => {
    const stateChanger = () => {
        console.log(item)
    }
    return (
        <div onClick={stateChanger} className={itemCss.item}>

            <b>{item.title}</b>
            <img width={30} height={30}  src={correct} alt="done"/>

        </div>
    );
};

export default TodoItem;
